import React from 'react';
import { View, Button, Text } from 'react-native';

const Produtos = () => (
  <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center' }}>

    <Text>About</Text>
  </View>
);

Produtos.navigationOptions = {
  title: 'About',
}


export default Produtos;
